// App.js
import { BrowserRouter, Routes, Route } from "react-router-dom";


import React from 'react';
import BgVideo from './components/BgVideo';
import Navbar from './components/Navbar';
//import LoginForm from './components/LoginForm';
function App() {
  return (
    <div className="app">
      <BrowserRouter>
        <Routes>
          <BgVideo />
          <Navbar />

        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
